import React, { useEffect, useRef } from 'react';

const MapComponent = () => {
  const mapRef = useRef(null);

  useEffect(() => {
    // Cargar la API de Google Maps
    const loadGoogleMaps = () => {
      const script = document.createElement('script');
      script.src = `https://maps.googleapis.com/maps/api/js?key=AIzaSyBomnY9UemevV5IVEXtYHP6SWw3kRsERGc&libraries=marker`;
      script.async = true;
      script.defer = true;
      script.onload = () => initializeMap();
      document.head.appendChild(script);
    };

    // Inicializar el mapa y agregar marcadores
    const initializeMap = () => {
      const map = new google.maps.Map(mapRef.current, {
        center: { lat: -34.397, lng: 150.644 },
        zoom: 8,
      });

      // Agregar AdvancedMarkerElement
      const marker = new google.maps.marker.AdvancedMarkerElement({
        position: { lat: -34.397, lng: 150.644 },
        map,
        title: "Marker Title",
      });
    };

    loadGoogleMaps();
  }, []);

  return (
    <div>
      <h2>Mapa de Google con Marcador Avanzado</h2>
      <div ref={mapRef} style={{ height: '500px', width: '100%' }} />
    </div>
  );
};

export default MapComponent;
